{'full_text': '야! 너! 끼부리고 다니지마. 질투나고 군인이라서 서러워! 그리고 내가 걔네들 다 이기는 이유가 뭔 줄 알아? 나 곧 있음 전역인데 걔들은 곧 있음 입대야 그러닌깐 나한테 와! 알겠어? 
